import React, { Component, Fragment } from 'react';
import './../css/welcome.css'
import ADBrand from './../img/ADbrand.svg';
import ArrowDown from './../img/arrow-down.svg';

export default class Welcome extends Component{
    render(){
        return(
            <Fragment>
                <section className="parallax" id="parallax-intro">
                    <div id="logo-brand">
                        <img src={ADBrand} alt="AD logo"/>
                    </div>
                    <button disabled>Scroll down
                        <img src={ArrowDown} alt="scroll-down"/>
                    </button>
                </section>
                <section >
                    <p>Bonjour je m'appelle Adrien</p>
                </section>
                <section className="parallax" id="parallax-presentation">
                    <div id="logo-brand">
                        <img src={ADBrand} alt="AD logo"/>
                    </div>
                    <button disabled>Scroll down
                        <img src={ArrowDown} alt="scroll-down"/>
                    </button>
                </section>
            </Fragment>
        )
    };
}
